import { MaterialIcons } from '@expo/vector-icons';

const HomePage = ({ navigation }) => {
    return (
        <View style={styles.container}>
            <Text>asdasdas</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#120E0B',
        alignItems: 'center',
        width: '100%',
        marginTop: 30,
