    iconMastercard: {
        width: 50,
        height: 30,
    },
    price: {
        color: '#fff',
        fontSize: 45,
        marginTop: 28,
    },
    mastercard: {
        flexDirection: 'row',
        justifyContent: 'flex-end',
    },
    bold: {
        fontWeight: 'bold',
    },
    info: {
        flexDirection: 'row',
        justifyContent: "space-between",
        marginTop: 'auto'
    },
    infoDate: {
        color: '#fff',
        backgroundColor: '#5A5857',
        padding: 4,
        borderRadius: 50,
    },
    infoCode: {
        color: '#5A5857',
    },
    userInfo: {
        flexDirection: 'row',
        alignItems: 'center',
    },
});

export default HomePage;
